sols(1,:) = V(2,:);
%l2
sols(2,:) = V(3,:);
%k
sols(3,:) = diag(D).';

l1 = sols(1,:);
l2 = sols(2,:);
k = sols(3,:);

    for i = 1:size(l1,2)
        
        M1 =  [                                                           - x11(2)*(k(i)*(x1p1(1)^2 + x1p1(2)^2) + 1) - l1(i)*x11(2)*x1p1(1) - l2(i)*x11(2)*x1p1(2), x11(1)*(k(i)*(x1p1(1)^2 + x1p1(2)^2) + 1) + l1(i)*x11(1)*x1p1(1) + l2(i)*x11(1)*x1p1(2),                                                           0,                                          x11(1)*x1p1(2) - x11(2)*x1p1(1); ...
