                                                                                                                          l1(i),                                                              l2(i),                                                                 1,                                                            0];
     
        [~,~,U] = svd(M2);
        
        u1(i) = U(1,end)/U(4,end);
        u2(i) = U(2,end)/U(4,end);
        u3(i) = U(3,end)/U(4,end);
        
        s(i) = (-x41(1)*x4p1(2) + x41(2)*x4p1(1))/(-(k(i)*(x4p1(1)^2 + x4p1(2)^2) + 1)*(u1(i)*x41(2) - u2(i)*x41(1)) - x4p1(1)*(l1(i)*u1(i)*x41(2) - l1(i)*u2(i)*x41(1)) - x4p1(2)*(l2(i)*u1(i)*x41(2) - l2(i)*u2(i)*x41(1)));
    end
    
    

    

